import React from 'react';
import Grid from '@mui/material/Grid';
import MediaCard from "../MediaCard";
import transformerBar from "../pictures/TransformerBar.jpeg";

function Rogue() {
    return (
        <Grid 
            container
            direction="column" 
            justifyContent="flex-start" 
            spacing={5}
        >
            <Grid 
                item                
                sx={{
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    width: 1
                }}
            >
            <MediaCard
                title="Kabuki Transformer Bar"
                img={transformerBar}
                alt="Rogue Fitness"
                imgBorderRadius="10px"
                imgWidth="0.8"
                infoList={[
                        ["THIS IS A TEST", "it's a gpa."],
                        ["Outline of Program", "the program is of such information and learning."],
                        ["Class Highlights", "classes i've taken are of such variety"]
                ]}
            />
            </Grid>
        </Grid>
    );
}

export default Rogue;
